export const setDishes = (items) => ({
	type: 'SET_DISHES',
	payload: items,
})

export const setMenuDishes = (items) => ({
	type: 'SET_MENU_DISHES',
	payload: items,
})

export const setDeliveryDishes = (items) => ({
	type: 'SET_DELIVEY_DISHES',
	payload: items,
})
